// Enhanced Session Context Manager for Booking Agent
const phoneNumber = $input.all()[0].json.messages[0].from;
const messageText = $input.all()[0].json.messages[0].text.body;
const timestamp = new Date().toISOString();
const sessionId = `${phoneNumber}_${new Date().toISOString().split('T')[0]}`;

// Create comprehensive session context
const sessionContext = {
  user_phone: phoneNumber,
  session_id: sessionId,
  last_interaction: timestamp,
  message_text: messageText,
  conversation_flow: {
    current_step: determineCurrentStep(messageText),
    last_action: null,
    booking_in_progress: false,
    needs_session_data: shouldFetchSessionData(messageText)
  },
  user_data: {
    name: null,
    email: null,
    age: null,
    gender: null
  },
  booking_context: {
    current_appointment_id: null,
    specialization_id: null,
    doctor_id: null,
    branch_id: null,
    doctor_time_slot_id: null,
    purpose_of_meet: null
  },
  session_stats: {
    message_count: 1,
    session_start: timestamp,
    last_booking_id: null
  }
};

function determineCurrentStep(message) {
  const lowerMsg = message.toLowerCase();
  if (lowerMsg.includes('book') || lowerMsg.includes('appointment')) {
    return 'booking_initiation';
  } else if (lowerMsg.includes('reschedule')) {
    return 'rescheduling';
  } else if (lowerMsg.includes('cancel')) {
    return 'cancellation';
  } else if (lowerMsg.includes('my booking') || lowerMsg.includes('booking id') || lowerMsg.includes('my appointment')) {
    return 'booking_inquiry';
  } else if (lowerMsg.includes('intake')) {
    return 'intake_form';
  }
  return 'general_inquiry';
}

function shouldFetchSessionData(message) {
  const lowerMsg = message.toLowerCase();
  return lowerMsg.includes('my') || lowerMsg.includes('reschedule') || lowerMsg.includes('cancel') || lowerMsg.includes('booking id');
}

return [{
  json: {
    ...$input.all()[0].json,
    session_context: sessionContext
  }
}];

